var tipuesearch = {"pages": [{'title': '各組期末報告說明', 'text': '第十七週前請完成個人期末報告影片與各項查驗資料準備 \n 參考網址: https://2019wcm.blogspot.com/ \n 宣告重點: 至今仍無個人課程網頁內容者、未每週持續提交工作進度者、未實際拍攝各週操作影片以及未實際根據評分項目參與各分組與全班協同者, 最後將無法順利取得修課及格之學期成績. \n \n 請本學期選修協同產品設計實習與網際內容管理課程的同學特別注意, 務必在第十七週上課前, 依據各週所提交推送的操作影片、Github 倉儲提交紀錄、個人網頁、分組網頁與全班協同網頁等資料, 配合下列各課程評分比列進行具體自評. 第十七週與第十八週將分別請每一位同學上台進行期末簡報, 詳細說明本學期各項評分項目中的自評內容與分數. 每一位學員自我查驗項目: 1. 是否在第十七週上課前完成個人至多 5 分鐘的期末報告影片, 上傳至以學號登錄的 Youtube 帳號下, 並分別嵌入個人網站中, 且標題分別為: \xa0 \xa0 \xa0 協同產品設計實習課程 \xa0 \xa0 \xa0 \xa0 國立虎尾科技大學 - 機械設計工程系 - 協同產品設計實習期末報告 - 學號 - 姓名 \xa0 \xa0 \xa0 四技部網際內容管理課程 \xa0 \xa0 \xa0 \xa0 國立虎尾科技大學 - 機械設計工程系 - 網際內容管理期末報告 - 學號 - 姓名 \xa0 \xa0 \xa0 五專部網際內容管理課程 \xa0 \xa0 \xa0 \xa0 國立虎尾科技大學 - 精密機械工程科 - 網際內容管理期末報告 - 學號 - 姓名 \xa0 \xa0 \xa0 請注意: \xa0 未按照上述規定完成期末報告影片署名與提交嵌入者, 一律不予計分. 2. 每一位學員上台進行期末自評簡報時, 必須舉證個人在各週實際完成的 Github 倉儲歷程資料, 說明個人在分組與全班協同過程中所扮演的角色與貢獻, 且依據課程評分比例進行自評. 以下為各課程的學員評分比例與評分方式: 協同產品設計實習課程 評分比例: \xa0 \xa0 學員出席 (20%) \xa0 \xa0 Github 倉儲管理\xa0 (20%) \xa0 \xa0 Onshape 協同操作 (20%) \xa0 \xa0 V-rep 模擬 (20%) \xa0 \xa0 程式開發 (20%) 評分方式: \xa0 \xa0 CD 每週自評與互評表單: \xa0 https://goo.gl/forms/qtk5fxdeGYHCeI1M2 \xa0 \xa0 學員自我評量 (30%) \xa0 \xa0 分組自我評量 (30%) \xa0 \xa0 倉儲歷程查驗 (40%) 網際內容管理課程 評分比例: \xa0 \xa0 學員出席 (20%) \xa0 \xa0 電腦組裝與操作系統安裝 (10%) - 以 Virtualbox 虛擬主機配置與設定取代實體安裝 \xa0 \xa0 網路連線配置與設定\xa0 (10%) \xa0 \xa0 Github 倉儲與 CMSimfly 配置 (30%) \xa0 \xa0 CMSimfly 操作 (20%) \xa0 \xa0 CMSimfly 開發 (10%) 評分方式: \xa0 \xa0 WCM 每週自評與互評表單: \xa0 https://goo.gl/forms/gExeWw3JIrenXi453 \xa0 \xa0 學員自我評量 (30%) \xa0 \xa0 分組自我評量 (30%) \xa0 \xa0 倉儲歷程查驗 (40%)', 'tags': '', 'url': '各組期末報告說明.html'}, {'title': '執行規劃', 'text': 'W11分配各組員所負責之項目 \n W12至 W16為各組員所需完成之項目 \n W16至W17為期末專案PDF製作 \n 各個組員所分配工作如下 \xa0 ： \n 吳柔燕 \xa0 ：設計與繪圖 \n 潘季宏\xa0 ：設計與繪圖 \n 趙家傑\xa0 ：設計與繪圖 \n 葉修宏 ：V-rep模擬與程式設計 \n 吳承哲\xa0：V-rep模擬與 程式設計 \n 翁俊揚\xa0：V-rep回球機構繪圖及模擬 \n 王映捷\xa0 ：V-rep回球機構繪圖及模擬 \n 李昀霖：V-rep模擬', 'tags': '', 'url': '執行規劃.html'}, {'title': '手足球系統模擬', 'text': '專案成果摘要 \n 1.手足球桌檯設計與繪圖 \n 2.手足球 vrep 模擬 \n 3.迴球、送球機構設計&模擬 \n 4.Vrep 程式簡化模擬 \n 5.桌檯細部設計與 BOM \n 專案執行動機 \n \xa0 \xa0 \xa0 \xa0 \xa0 相信大家小時候都玩過或看過類似的手足球機台，但是現在在我們周遭這種東西已經少之又少。為了重回小時候對手足球的熱情，我們試著把它用電腦模擬出來，並製作回球機構， 使我們的手足球機台可以比以前的更加方便。 \n 專案執行成員 \n 40623102 \xa0 吳柔燕\xa0 \xa0 \xa0 \xa0 \xa0\xa0 40623124 \xa0 葉修宏 \n 40623110 \xa0 翁俊揚\xa0 \xa0 \xa0 \xa0 \xa0\xa0 40623132 \xa0 趙家傑 \n 40623111 \xa0 王映捷\xa0 \xa0 \xa0 \xa0 \xa0\xa0 40623144 \xa0 林昭權 \n 40623113 \xa0 吳承哲\xa0 \xa0 \xa0 \xa0 \xa0\xa0 40623152 \xa0 潘季宏 \n 40623121 \xa0 蔡朝旭\xa0 \xa0 \xa0 \xa0 \xa0\xa0 40623157 \xa0 李昀霖 \n 執行使用套件 \n Onshape 、V-rep、 Github \xa0、 SciTE \n 專案執行過程規劃 \n W11分配各組員所負責之項目 \n W12至 W16為各組員所需完成之項目 \n W16至W17為期末專案PDF製作 \n 專案執行內容 \n 專案結論 \n 相關文獻探討 \n 台桌尺寸規格 、 球的尺寸 \xa0、 手足球人偶 \xa0、 Python 程式語法', 'tags': '', 'url': '手足球系統模擬.html'}, {'title': '設計與繪圖', 'text': '', 'tags': '', 'url': '設計與繪圖.html'}, {'title': '零組件尺寸分析', 'text': '手足球零件尺寸參考來自:   https://2019wcm.blogspot.com/search/label/foosball \n 手足球系統的零組件尺寸分析 (可行性分析) \n 尺寸單位 : inch( 吋 ) \n 1.檯桌尺寸 (長:56\xa0 \xa0寬:30\xa0 \xa0高:5) \n 2.橫桿插入孔尺寸(直徑:0.563\xa0 \xa0距底部:2.75\xa0 \xa0 孔間距:6) \n 3.球門尺寸(寬:4.5\xa0 長:3\xa0 \xa0距底部:0.8 ) (初版) \n 球門尺寸 最終版  (為了連接送 球軌道與 送球機構 ) (寬: 10) \n 4.橫桿尺寸(長:70\xa0 \xa0直徑:0.563) \n *球桿直徑與桌檯孔洞呈鬆配合 ，考慮到是否會讓球員在移動時無法完整移動至左右，以及使用者好操作等因素，決定將原本的40in改成70in。 \n 5.球員尺寸(長:1.5\xa0 \xa0寬:1\xa0 \xa0高:3\xa0 \xa0圓孔:0.563\xa0 \xa0 距底部:0.9) \n \n *球員孔洞需與衡感直徑呈緊配合，必須使球員能隨橫桿轉動 。 本來設定球員尺寸時，為了讓球員能順利擊球而避免卡到球的問題，所以球員與底部的距離必須小於球的直徑。 \n 6.球尺寸(直徑:0.15) \n *球的直徑要大於球員距底板的距離，才不會發生卡球等問題 。 \n 7. 送球軌道 \n *由於尺寸需要配合送球機構以及球體尺寸的關係，軌道內側寬度設為2 。 \n *為了讓球能順利進入送球機構，球門至最靠近送球機構軌道的彎道改為倒角。 \n *為了使球能不因為速度過快而彈至軌道外，而將軌道坡度減緩至10度左右。 \n *為了讓球能從最後的V字軌道順利進入場地，而把入口改為方形入口。 \n *為了讓球能順利的進入場中 ，方形入口前的軌道改為L型斜坡。 \n 8.送球機構 \n *送球機構由圓盤和主旋轉軸組成 ，經由圓盤上的圓孔收入圓球，再由主傳動軸旋轉帶入至上方軌道。 \n *為了讓球能順利進入軌道 ，入球孔大小與出球孔大小有差距，進而形成小斜坡。 \n 手足球系統的零組件參數設計與繪圖 (零組件初步設計繪圖) \n Onshape 零組件連結 \n https://cad.onshape.com/documents/2cc966a037073bad4c2e2769/w/446907d51186d2c31c8d8b90/e/a5bc1080e53d9efa9e22a820 \n 球檯繪圖 \n \n 繪製與組裝 \n \n', 'tags': '', 'url': '零組件尺寸分析.html'}, {'title': '細部設計與 BOM', 'text': '完成手足球零組件細部設計 (可參考  https://youtu.be/PgnvZV5s13c  中各項設計), 並將設計 BOM (Bill of Materials) 納入 CMSimfly 網際內容管理系統. (系統 BOM 文件整理) \n 手足球 DIY 影片: \n \n \n 參考資料: \n https://www.matterhackers.com/articles/how-to-build-a-foosball-table \n https://www.matterhackers.com/store/digital-designs/foosball-table-parts \n 手足球零件格式說明 \n 手足球零件格式說明 \n 零件 BOM \n 手足球零組件材料表 (含零組件下載連結) \n https://cad.onshape.com/documents/2cc966a037073bad4c2e2769/w/446907d51186d2c31c8d8b90/e/a5bc1080e53d9efa9e22a820 \n 零件尺寸圖 \n 零件尺寸圖 \n 球桌 \n 球員 \n 手桿 \n 運球轉輪 \n 運球機構 \n 零件部分組裝圖 \n 零件部分組裝圖 \n 3D 零組件爆炸圖 \n 3D 零組件爆炸圖 \n', 'tags': '', 'url': '細部設計與 BOM.html'}, {'title': 'V-rep 動態模擬', 'text': '手足球系統中各球員擊球與操控桿移動旋轉的 V-rep 動態模擬 (系統功能模擬) \n 以文字及操作影片說明如何從 Onshape 設計繪製零組件後, 如何轉入 V-rep, 如何編寫程式, 如何進行各種功能測試, 最後完成手足球的 V-rep 動態模擬系統. \n 檔案位置： football table.ttt \n', 'tags': '', 'url': 'V-rep 動態模擬.html'}, {'title': '問題和討論', 'text': 'Q：遇到球無法滾出球門？ \n A：有可能是因為你簡化的過程，簡化的模型太高，而導致球會卡在球門，所以遇到類似情形把簡化的模型刪掉即可 \n Q： 球進門後卡在球門下？ \n A： 繪製草圖時因不小心讓那裏成為平台，而導致球無法向下滾動，所以我們把那個地方改成斜面即可！ \n Q： 球順著軌道滾動後卡在回球機構的門口？ \n A： 把送球機構的孔洞放大，讓球得以順利通過返回球桌！ \n Q：如何讓桿子偵測到球體的位置並進行移動和反擊? \n A：先利用指令得知球體的 Y 方向座標，再進行相減得到值即可確認球體在桿子的右邊還是左邊，並使桿子確實反擊 \n Q：要如何得知球體目前的位置? \n A：使用指令 number returnCode,number parentObjectHandle = vrep.simxGetObjectParent(number clientID,number objectHandle,number operationMode)即可得知目前球體的座標位置 \n', 'tags': '', 'url': '問題和討論.html'}, {'title': '簡化模擬', 'text': '首先在  onshape  將想要使用的零件圖或組合圖按照如下圖 \n 匯出成 .stl  檔，再至 v-rep  中開啟 .stl  檔   使用  [File – >Import – >Mash … ] ，如下圖 \n 依據個人所需去做點選，在按  OK  即可在視窗中導入模型。可以從下圖中看出 \n 導入的模型是未分離的模型  ( 如若是零件圖則不須此步驟 ) ， \n 所以我們使用\xa0 [Edit– >Grouping/Merging – >Divideselectedshapes]\xa0\xa0 來將模型中的物件全都爆開，如下圖 \n 接下來說明桌檯簡化步驟 \n 1 . 使用 [File – >Newscene] 建立新的檔案 ， \xa0 然後 使用\xa0 [Edit>CopyselectedObjects]\xa0 到一個新建的場景 。 \n 2 . 將人物貼上   使用\xa0  [Edit  – > Paste buffer] 。 \n 再點選簡化 的對話框  Operations on selected triangles  中的  Extract cuboid\xa0 如下圖 \n 5 . 之後會出現  Primitive cuboid  的對話框並按下  OK  即會產生一個立方體如下圖 \n 桌檯的簡化 就完成了 ！ \xa0 \n 簡化示範影片 ： \xa0 \n \n', 'tags': '', 'url': '簡化模擬.html'}, {'title': '送球機構設計與模擬', 'text': '手足球發球與進球後自動送球機構設計與 V-rep 動態模擬 (機構與傳動系統設計與模擬) \n 可採用螺旋機構或多連桿機構設計, 透過進球感測器感應後, 將儲存於螺桿上的球送回球檯. \n 以下為參考機構模擬影片: \n \n \n \n 簡化模擬', 'tags': '', 'url': '送球機構設計與模擬.html'}, {'title': '設計與模擬影片', 'text': '\n Vrep基本設定 \n \n 設計(二) \n \n 手足球迴球機構Vrep模擬 \n \n V-rep送球模擬 \n \n', 'tags': '', 'url': '設計與模擬影片.html'}, {'title': '系統功能展示', 'text': '程式參考來自第3組網站與詢問第一.三組 \n', 'tags': '', 'url': '系統功能展示.html'}, {'title': '手足球雙人鍵盤對打', 'text': '檔案: new football \n V-REP模擬結果 \n PYTHON程式碼 \n import vrep\nimport keyboard\nfrom time import sleep\nimport sys, math\nvrep.simxFinish(-1) \nclientID = vrep.simxStart("127.0.0.1", 19997, True, True, 5000, 5)  \nKickBoV = 90   \nn=1\nL_KickBoV = (math.pi/180)*KickBoV\nR_KickBoV = -(math.pi/180)*KickBoV\nif clientID!= -1:  \n    print(\'connect successfully\')\nelse:\n    print(\'connect failed\')\n    vrep.simxFinish(clientID)\nprint(\'program ended\')\n\n\n\n  \nerrorCode,Sphere_handle=vrep.simxGetObjectHandle(clientID,\'Sphere\',vrep.simx_opmode_oneshot_wait)\nerrorCode,Pole_handle=vrep.simxGetObjectHandle(clientID,\'Pole\',vrep.simx_opmode_oneshot_wait)\nerrorCode,Revolute_handle=vrep.simxGetObjectHandle(clientID,\'Revolute\',vrep.simx_opmode_oneshot_wait)\nerrorCode,Prismatic_handle=vrep.simxGetObjectHandle(clientID,\'Prismatic\',vrep.simx_opmode_oneshot_wait)\nerrorCode,Revolute2_handle=vrep.simxGetObjectHandle(clientID,\'Revolute2\',vrep.simx_opmode_oneshot_wait)\nerrorCode,Prismatic2_handle=vrep.simxGetObjectHandle(clientID,\'Prismatic2\',vrep.simx_opmode_oneshot_wait)\nerrorCode,Pole2_handle=vrep.simxGetObjectHandle(clientID,\'Pole2\',vrep.simx_opmode_oneshot_wait)\n \nif errorCode == -1:\n    print(\'Can not find left or right motor\')\n    sys.exit()\n     \n\n     \ndef start():\n    errorCode = vrep.simxStartSimulation(clientID,vrep.simx_opmode_oneshot_wait)\n    while True:\n        try:\n            if keyboard.is_pressed(\'r\'):\n                vrep.simxSetJointTargetVelocity(clientID,Revolute_handle,R_KickBoV,vrep.simx_opmode_oneshot_wait)\n            elif keyboard.is_pressed(\'t\'):\n                vrep.simxSetJointTargetVelocity(clientID,Revolute_handle,L_KickBoV,vrep.simx_opmode_oneshot_wait)\n            elif keyboard.is_pressed(\'q\'):\n                vrep.simxSetJointTargetVelocity(clientID,Prismatic_handle,0.05,vrep.simx_opmode_oneshot_wait)\n            elif keyboard.is_pressed(\'w\'):\n                vrep.simxSetJointTargetVelocity(clientID,Prismatic_handle,0,vrep.simx_opmode_oneshot_wait)\n            elif keyboard.is_pressed(\'e\'):\n                vrep.simxSetJointTargetVelocity(clientID,Prismatic_handle,-0.05,vrep.simx_opmode_oneshot_wait)\n             \n            elif keyboard.is_pressed(\'.\'): \n                vrep.simxSetJointTargetVelocity(clientID,Revolute2_handle,L_KickBoV,vrep.simx_opmode_oneshot_wait)\n            elif keyboard.is_pressed(\'/\'):  \n                vrep.simxSetJointTargetVelocity(clientID,Revolute2_handle,R_KickBoV,vrep.simx_opmode_oneshot_wait)\n            elif keyboard.is_pressed(\'b\'):  \n                vrep.simxSetJointTargetVelocity(clientID,Prismatic2_handle,0.05,vrep.simx_opmode_oneshot_wait)\n            elif keyboard.is_pressed(\'n\'):  \n                vrep.simxSetJointTargetVelocity(clientID,Prismatic2_handle,0,vrep.simx_opmode_oneshot_wait)\n            elif keyboard.is_pressed(\'m\'):  \n                vrep.simxSetJointTargetVelocity(clientID,Prismatic2_handle,-0.05,vrep.simx_opmode_oneshot_wait)\n            else:\n                pass\n        except:\n            break\n        \nstart()\n \n', 'tags': '', 'url': '手足球雙人鍵盤對打.html'}, {'title': '手足球手控與電腦對打', 'text': '檔案: new football \n V-REP模擬結果 \n \n PYTHON程式碼 \n import vrep\nimport keyboard\nimport  time \nimport sys, math\nvrep.simxFinish(-1) \nclientID = vrep.simxStart("127.0.0.1", 19997, True, True, 5000, 5)  \nKickBoV = 360\nL_KickBoV = (math.pi/180)*KickBoV\nR_KickBoV = -(math.pi/180)*KickBoV\nif clientID!= -1:  \n    print(\'connect successfully\')\nelse:\n    print(\'connect failed\')\n    vrep.simxFinish(clientID)\nprint(\'program ended\')\n    \n    \n    \n    \nerr,Sphere_handle=vrep.simxGetObjectHandle(clientID,\'Sphere\',vrep.simx_opmode_oneshot_wait)\nerr,Pole_handle=vrep.simxGetObjectHandle(clientID,\'Pole\',vrep.simx_opmode_oneshot_wait)\nerr,Revolute_handle=vrep.simxGetObjectHandle(clientID,\'Revolute\',vrep.simx_opmode_oneshot_wait)\nerr,Prismatic_handle=vrep.simxGetObjectHandle(clientID,\'Prismatic\',vrep.simx_opmode_oneshot_wait)\nerr,Revolute2_handle=vrep.simxGetObjectHandle(clientID,\'Revolute2\',vrep.simx_opmode_oneshot_wait)\nerr,Prismatic2_handle=vrep.simxGetObjectHandle(clientID,\'Prismatic2\',vrep.simx_opmode_oneshot_wait)\nerr,Pole2_handle=vrep.simxGetObjectHandle(clientID,\'Pole2\',vrep.simx_opmode_oneshot_wait)\n \n\n\nif err == -1:\n    print(\'Can not find left or right motor\')\n    sys.exit()\n    \n    \n    \ndef speed(handle,speed):\n    err = vrep.simxSetJointTargetVelocity(clientID,handle,speed,vrep.simx_opmode_oneshot_wait)\ndef start():\n    err=vrep.simxStartSimulation(clientID,vrep.simx_opmode_oneshot_wait)\n    while True:\n        err,position_LR=vrep.simxGetObjectPosition(clientID,Revolute2_handle,-1,vrep.simx_opmode_oneshot)\n        err,position_S=vrep.simxGetObjectPosition(clientID,Sphere_handle,-1,vrep.simx_opmode_oneshot)\n        err,position_RR=vrep.simxGetObjectPosition(clientID,Revolute_handle,-1,vrep.simx_opmode_oneshot)\n        LP =position_S[1] -position_LR[1] \n        LPP =position_S[0] - position_LR[0]\n        print(position_S)\n        if LPP >-0.015:\n            speed(Revolute2_handle,L_KickBoV)\n        elif LPP <= -0.015:\n            speed(Revolute2_handle,R_KickBoV)\n        else:\n            pass\n        try:\n            if keyboard.is_pressed(\'r\'):\n                vrep.simxSetJointTargetVelocity(clientID,Revolute_handle,R_KickBoV,vrep.simx_opmode_oneshot_wait)\n            elif keyboard.is_pressed(\'t\'):\n                vrep.simxSetJointTargetVelocity(clientID,Revolute_handle,L_KickBoV,vrep.simx_opmode_oneshot_wait)\n            elif keyboard.is_pressed(\'q\'):\n                vrep.simxSetJointTargetVelocity(clientID,Prismatic_handle,0.1,vrep.simx_opmode_oneshot_wait)\n            elif keyboard.is_pressed(\'w\'):\n                vrep.simxSetJointTargetVelocity(clientID,Prismatic_handle,0,vrep.simx_opmode_oneshot_wait)\n            elif keyboard.is_pressed(\'e\'):\n                vrep.simxSetJointTargetVelocity(clientID,Prismatic_handle,-0.1,vrep.simx_opmode_oneshot_wait)\n            else:\n                pass\n        except:\n            break\n        Pv = LP*2.5\n        vrep.simxSetJointTargetVelocity(clientID,Prismatic2_handle,Pv,vrep.simx_opmode_oneshot_wait)\n      \n        \nvrep.simxSetJointTargetVelocity(clientID,Prismatic_handle,0,vrep.simx_opmode_oneshot_wait)       \nvrep.simxSetJointTargetVelocity(clientID,Prismatic2_handle,0,vrep.simx_opmode_oneshot_wait)\n\n        \n        \n\nstart()\n \n', 'tags': '', 'url': '手足球手控與電腦對打.html'}, {'title': '手足球電腦與電與對打', 'text': '檔案: new football \n V-REP程式模擬結果 \n \n PYTHON程式碼 \n import vrep\nimport keyboard\nimport  time \nimport sys, math\nvrep.simxFinish(-1) \nclientID = vrep.simxStart("127.0.0.1", 19997, True, True, 5000, 5)  \nKickBoV = 360\nL_KickBoV = (math.pi/180)*KickBoV\nR_KickBoV = -(math.pi/180)*KickBoV\nif clientID!= -1:  \n    print(\'connect successfully\')\nelse:\n    print(\'connect failed\')\n    vrep.simxFinish(clientID)\nprint(\'program ended\')\n    \n    \n    \n    \n\nerr,Sphere_handle=vrep.simxGetObjectHandle(clientID,\'Sphere\',vrep.simx_opmode_oneshot_wait)\nerr,Pole_handle=vrep.simxGetObjectHandle(clientID,\'Pole\',vrep.simx_opmode_oneshot_wait)\nerr,Revolute_handle=vrep.simxGetObjectHandle(clientID,\'Revolute\',vrep.simx_opmode_oneshot_wait)\nerr,Prismatic_handle=vrep.simxGetObjectHandle(clientID,\'Prismatic\',vrep.simx_opmode_oneshot_wait)\nerr,Revolute2_handle=vrep.simxGetObjectHandle(clientID,\'Revolute2\',vrep.simx_opmode_oneshot_wait)\nerr,Prismatic2_handle=vrep.simxGetObjectHandle(clientID,\'Prismatic2\',vrep.simx_opmode_oneshot_wait)\nerr,Pole2_handle=vrep.simxGetObjectHandle(clientID,\'Pole2\',vrep.simx_opmode_oneshot_wait)\n \n\nif err == -1:\n    print(\'Can not find left or right motor\')\n    sys.exit()\n    \n    \n    \ndef speed(handle,speed):\n    err = vrep.simxSetJointTargetVelocity(clientID,handle,speed,vrep.simx_opmode_oneshot_wait)\ndef start():\n    err=vrep.simxStartSimulation(clientID,vrep.simx_opmode_oneshot_wait)\n    while True:\n        err,position_LR=vrep.simxGetObjectPosition(clientID,Revolute2_handle,-1,vrep.simx_opmode_oneshot)\n        err,position_S=vrep.simxGetObjectPosition(clientID,Sphere_handle,-1,vrep.simx_opmode_oneshot)\n        err,position_RR=vrep.simxGetObjectPosition(clientID,Revolute_handle,-1,vrep.simx_opmode_oneshot)\n        LP =position_S[1] - position_LR[1] \n        LPP =position_S[0] - position_LR[0]\n        RP =position_S[1] - position_RR[1] \n        RPP =position_S[0] - position_RR[0]\n        print(position_S)\n        if LPP <-0.015:\n            speed(Revolute2_handle,R_KickBoV)\n        elif LPP >= -0.015:\n            speed(Revolute2_handle,L_KickBoV)\n        else:\n            pass\n        if RPP >0.015:\n            speed(Revolute_handle, L_KickBoV)\n        elif RPP <= 0.015:\n            speed(Revolute_handle,R_KickBoV)\n        else:\n            pass\n        Pv = LP*3\n        PPV=RP*3\n        vrep.simxSetJointTargetVelocity(clientID,Prismatic2_handle,Pv,vrep.simx_opmode_oneshot_wait)\n        vrep.simxSetJointTargetVelocity(clientID,Prismatic_handle,Pv,vrep.simx_opmode_oneshot_wait)\nvrep.simxSetJointTargetVelocity(clientID,Prismatic_handle,0,vrep.simx_opmode_oneshot_wait)       \nvrep.simxSetJointTargetVelocity(clientID,Prismatic2_handle,0,vrep.simx_opmode_oneshot_wait)\n        \n\nstart() \n', 'tags': '', 'url': '手足球電腦與電與對打.html'}, {'title': '模擬問題與討論', 'text': '在模擬上遇到的幾個問題 \n 1.開始模擬時桿子會自行移動 \n 給他初始速度為0即可靜止 \n 2.程式GO的時候 def SPEED發生錯誤 \n 給他定義值即可解錯 \n 3.開始模擬時桿子追蹤球的Y軸位置與球的Y軸路徑相反 \n 注意下放給定移動值的數值是否有負號，有的畫刪除即可，或是更改上方的正負關系即可 \n 4.無法擊球 \n 若無法擊球可嘗試在距離潛在負號或是更改大小於關係即可 \n 5.注意程式裡與V-REP的軸名稱要相同', 'tags': '', 'url': '模擬問題與討論.html'}, {'title': '總結報告', 'text': '', 'tags': '', 'url': '總結報告.html'}, {'title': '專案口頭簡報', 'text': '各組利用倉儲中的 Reveal.js 進行結案簡報 (結案口頭簡報) \n', 'tags': '', 'url': '專案口頭簡報.html'}, {'title': '專案報告書', 'text': '各組完成 html 與 pdf 格式之手足球專案結案報告 (文字結案報告 \n \n ag4手足球專案報告-1 \n ag4手足球專案報告-2 \n ag4手足球專案報告-3 \n', 'tags': '', 'url': '專案報告書.html'}, {'title': '如何編輯報告書', 'text': '可參考 : https://mdecp2018.github.io/finalproject-bgx/content/Kmol-editor.html \n 首先下載: miktex_portable_and_pandoc.7z \n 下載完成後解壓縮至隨身系統中(y槽中) \n 完成後會多出 兩個資料夾 \n 分別是 pandoc-2.4-windows-x86_64 和\xa0miktex_portable \n 接著用SciTE 開啟start.bat \n 並在path=的最後方新增 \n \n \n \n \n \n \n 1 \n \n \n \n %Disk%:\\pandoc-2.4-windows-x86_64;%Disk%:\\miktex_portable\\texmfs\\install\\miktex\\bin; \n \n \n \n \n \n \n \n 接著在 cmd(小黑窗) 中輸入 \n \n \n \n \n \n \n 1 \n \n \n \n python -m pip install pandoc-fignos pandoc-tablenos pandoc-eqnos \n \n \n \n \n \n \n \n 等他安裝完成 \n 完成後重新啟動可攜系統即可 \n \n', 'tags': '', 'url': '如何編輯報告書.html'}]};